import React from 'react';
import classes from'./Header.module.css'
const Header = () => {
    return (
        <header className = {classes.header}>
        <img src = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSZmHBqEIa3kcCUrO1vUf_MduTOpLuJFhQqX4kREr1BzzcMDfMT'/>
      </header>
    )
}
export default Header;
